import React from 'react';
import styled from 'styled-components';
import { Formulario } from '../FormularioSolicitud/elementos/Formularios';

const RtaTramite = () => {
  return (
  <main>
    <Formulario action="">
      <label htmlFor=''>Número de Radicado</label>
      <input type="text" placeholder="Ej. 1421326" />
      <p>Este campo es requerido, y solo acepta números</p>
    </Formulario>
  </main> 
  )
}
export default RtaTramite;
